import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import MainContents from './components/MainContents';

function App() {
  return (
    <Router>
      <Routes>
        <div className="App">
          <Route path='/home'>
          <Header/>
          <MainContents/>
          </Route>
        </div>
      </Routes>
    </Router>
  );
}

export default App;
